# Cross Validation Regression MAE
import pandas
from sklearn import model_selection
from sklearn.linear_model import LinearRegression
from yellowbrick.model_selection import cv_scores
url = "https://raw.githubusercontent.com/jbrownlee/Datasets/master/housing.data"
names = ['CRIM', 'ZN', 'INDUS', 'CHAS', 'NOX', 'RM', 'AGE', 'DIS', 'RAD', 'TAX', 'PTRATIO', 'B', 'LSTAT', 'MEDV']
dataframe = pandas.read_csv(url, delim_whitespace=True, names=names)
array = dataframe.values
X = array[:,0:13]
Y = array[:,13]
kfold = model_selection.KFold(n_splits=10, random_state=7, shuffle=True)
model = LinearRegression()
scoring = 'neg_mean_absolute_error'
results = cv_scores(model, X, Y, cv=kfold, scoring=scoring)
# results = model_selection.cross_val_score(model, X, Y, cv=kfold, scoring=scoring)
# print("MAE: %.3f (%.3f)" % (results.mean(), results.std()))

"""# Mean Absolute Error Interpretation:

Mean Absolute Error is done by taking the absolute difference between predicted and actual values and taking its average across the dataset.

$$ \text{Prediction Error} \to \text{Actual} - \text{Predicted Value} $$

Given our housing dataset, the  prediction error is calculated for each record of the test data set then we convert each error to a positive figure if negative. This is achieved by taking the absolute value for each error. Finally we calculate the mean value for all recorded absolute errors or the average sum of all absolute errors. Our actual MAE value is its positive counterpart, as neg_mean_absolute_error is simply the negation of the actual value.

Mathematically,

$$ MAE = {\frac{1}{n} \sum_{i=1}^n \vert y_i - \hat{y}_i \vert} $$

where
* $n$ = sample size
* $y$ = actual value
* $\hat{y}_i$ = predicted value

The lower the MAE, the higher the accuracy of the model is usually what is expected  to see if our model is doing well however due to scikits convention of negating the value. All scorer objects follow the convention that higher return values are better than lower return values. Making our model perform poorly.

2. Mean Squared Error
"""

# Cross Validation Regression MSE
import pandas
from sklearn import model_selection
from sklearn.linear_model import LinearRegression
from yellowbrick.model_selection import cv_scores
url = "https://raw.githubusercontent.com/jbrownlee/Datasets/master/housing.data"
names = ['CRIM', 'ZN', 'INDUS', 'CHAS', 'NOX', 'RM', 'AGE', 'DIS', 'RAD', 'TAX', 'PTRATIO', 'B', 'LSTAT', 'MEDV']
dataframe = pandas.read_csv(url, delim_whitespace=True, names=names)
array = dataframe.values
X = array[:,0:13]
Y = array[:,13]
kfold = model_selection.KFold(n_splits=10, random_state=7, shuffle=True)
model = LinearRegression()
scoring = 'neg_mean_squared_error'
results = cv_scores(model, X, Y, cv=kfold, scoring=scoring)
# results = model_selection.cross_val_score(model, X, Y, cv=kfold, scoring=scoring)
# print("MSE: %.3f (%.3f)" % (results.mean(), results.std()))

"""# Mean Squared Error Interpretation:

Mean Squared Error is done by squaring the difference between the predicted and actual value and taking its average across the dataset. Squaring the error gives higher weight to the outliers, which results in a smooth gradient for small errors. The reason for the squaring of the error is to remove any negative signs.

With the formula,

$$ MSE = \frac{1}{n} \sum_{i=1}^n (y_i - \hat{y}_i)^2 $$

Our MSE result for the housing data is = -23.747, as neg_mean_squared_error is being used, our actual result is simply its positive value making it 23.747. Same as our Mean Absolute Error, sckikits conventions for MSE when scoring a regression model is a maximal score would mean a minimal loss.

3. R^2 Metrics
"""

# Cross Validation Regression R^2
import pandas
from sklearn import model_selection
from sklearn.linear_model import LinearRegression
url = "https://raw.githubusercontent.com/jbrownlee/Datasets/master/housing.data"
names = ['CRIM', 'ZN', 'INDUS', 'CHAS', 'NOX', 'RM', 'AGE', 'DIS', 'RAD', 'TAX', 'PTRATIO', 'B', 'LSTAT', 'MEDV']
dataframe = pandas.read_csv(url, delim_whitespace=True, names=names)
array = dataframe.values
X = array[:,0:13]
Y = array[:,13]
kfold = model_selection.KFold(n_splits=10, random_state=7, shuffle=True)
